import './App.css';
import FixedIcons from './components/FixedIcons';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import About from './pages/About';
import Home from './pages/Home'
import PasswordCalculator from './pages/projects/PasswordCalculator'


function App() {
  return (
    <div className="container">
      <Router>
        <Navbar />
        <FixedIcons />

        <Switch>
          <Route path="/about">
          </Route>

          <Route path="/projects">
          </Route>

          <Route path="/contact">
            <About />
          </Route>

          <Route path="/password-calculator">
            <PasswordCalculator />
          </Route>

          <Route path="/">
            <Home />
          </Route>

        </Switch>

      </Router>
    </div>
  );
}

export default App;
